import { HttpClientModule } from "@angular/common/http";
import { TestBed } from "@angular/core/testing";
import { ItemListComponent } from "./item-list.component";
import { BrowserModule } from "@angular/platform-browser";
import { AppRoutingModule } from "../../../app-routing.module";
import { BrowserAnimationsModule } from "@angular/platform-browser/animations";
import { MatTableModule } from "@angular/material/table";
import { MatDialogModule } from "@angular/material/dialog";
import { MatCardModule } from "@angular/material/card";
import { MatButtonModule } from "@angular/material/button";
import { FormsModule, ReactiveFormsModule } from "@angular/forms";
import { MatFormFieldModule } from "@angular/material/form-field";
import { MatInputModule } from "@angular/material/input";
import { MatIconModule } from "@angular/material/icon";
import { MatChipsModule } from "@angular/material/chips";
import { ApiServiceMock } from "src/app/services/api.service.mock";
describe("ItemListComponent", () => {
    let component;
    let fixture;
    let apiService;
    let mockAlbums = [
        {
            userId: 1,
            id: 1,
            title: "quidem molestiae enim",
            thumbnailUrl: "https://via.placeholder.com/150/24f355"
        },
        {
            userId: 1,
            id: 2,
            title: "sunt qui excepturi placeat culpa",
            thumbnailUrl: "https://via.placeholder.com/150/24f355"
        },
        {
            userId: 2,
            id: 19,
            title: "velit pariatur quaerat similique libero omnis quia",
            thumbnailUrl: "https://via.placeholder.com/150/24f355"
        },
        {
            userId: 2,
            id: 20,
            title: "voluptas rerum iure ut enim",
            thumbnailUrl: "https://via.placeholder.com/150/24f355"
        }
    ];
    beforeEach(async () => {
        await TestBed.configureTestingModule({
            imports: [
                HttpClientModule,
                BrowserModule,
                AppRoutingModule,
                BrowserAnimationsModule,
                MatTableModule,
                MatDialogModule,
                MatCardModule,
                MatButtonModule,
                ReactiveFormsModule,
                MatFormFieldModule,
                MatIconModule,
                MatInputModule,
                FormsModule,
                MatChipsModule
            ],
            declarations: [ItemListComponent]
            // providers: [
            //   {
            //     provide: ApiService,
            //     useValue: ApiServiceMock
            //   }
            // ]
        }).compileComponents();
    });
    beforeEach(() => {
        fixture = TestBed.createComponent(ItemListComponent);
        component = fixture.componentInstance;
        fixture.detectChanges();
        apiService = ApiServiceMock;
    });
    it("should create", () => {
        expect(component).toBeTruthy();
    });
    it("should call getAlbums onInit", () => {
        // apiService.getData().and.returnValue(mockAlbums);
        expect(apiService.getData).toHaveBeenCalled();
    });
});
